```
#include<bits/stdc++.h>
//吹爆万能头!!! 
using namespace std;
struct teeth{
	int l,c;//用结构体存输入 
}a[1001];
int main(){
	int n,m,k,cnt[1001]={0}/*存该行最小活力值*/,ans=0;
	//ans存最终结果 
	std::cin>>n>>m>>k;
	//输入n,m,k 
	//吹爆std::!!!!!! 
	for(int i=1;i<=m;i++){
		cnt[i]=99999999;
		//初始化 
	}
	for(int i=1;i<=n;i++){
		std::cin>>a[i].l>>a[i].c;
		//依次输入每颗牙 
		cnt[a[i].l]=std::min(cnt[a[i].l],a[i].c);
		//把每一行的最小活力牙齿存进cnt[]去 
	}
	for(int i=1;i<=m;i++){
		ans+=cnt[i];
		//因为已把每行能吃的东西最大值存好了，只需加进ans即可 
	}
	cout<<std::min(ans,k);
	//和k比较，看有没有多吃  
	return 0;
	//完美结束 
} 
```
