> 题意：鲨鱼有n颗牙齿，分别分布于m行上，第i颗牙齿有一个初始活力值c[i]。鲨鱼有k个食物想要吃，但是，每吃掉一个食物就要消耗某一排牙齿的每一颗牙齿各1点活力，而鲨鱼必须保证每个牙齿的剩余活力不能到负数。求鲨鱼最多能吃到的食物个数。

解法：**模拟即可**

从输入开始一遍读入一遍求出该行牙齿中最小的活力值，复杂度O(n)，然后cnt从a[0]加到a[m]，累加1~m行牙齿的或力度和。总时间复杂度O(m+n)。

代码：
```cpp
#include <bits/stdc++.h>
using namespace std;
int main()
{
    int n,m,k;
    cin>>n>>m>>k;
    int i,cnt,x,c,a[m+1];//a[i]表示第i行牙齿中最小的活力值是多少
    cnt=0;
    for (i=1;i<=m;i++)
    {
    	a[i]=2147480000;//a数组的初始值要赋很大
    }
    for (i=1;i<=n;i++)
	{
        cin>>x>>c;
        a[x]=min(a[x],c);//每次读入时去a[x]和c中更小的一个
    }
    for (i=1;i<=m;i++)
	{
		cnt+=a[i];//cnt累加出每行牙齿最小活力值的和
	}
    cnt=min(cnt,k);//别忘了把cnt和k比个小
    cout<<cnt<<endl;
    return 0;
}
```

并不需要快排

因为一排牙齿中只要有一个活力值小于0就不能用了

所以开一个桶，记录每排牙齿初始活力值的最小值

另外！总共只有k个食物，所以输出时要与k取最小值！

本蒟蒻的超丑代码：
```cpp
#include <cmath>
#include <cstdio>
#include <cstring>
#include <iostream>
#include <algorithm>
using namespace std;
const int M=333333;
const int INF=2000000000;
int n,m,k,a[M];
inline int read(){//快速读入
	char c=getchar();int ans=0;
	while (c<'0'||c>'9') c=getchar();
	while (c>='0'&&c<='9') ans=(ans<<1)+(ans<<3)+(c^48),c=getchar();
	return ans;
}
int main(){
	n=read(),m=read(),k=read();
	for (int i=1;i<=m;i++) a[i]=INF;
    for (int i=1,x,c;i<=n;i++){
		x=read(),c=read();
		a[x]=min(a[x],c);
	}
	int ans=0;
	for (int i=1;i<=m;i++) ans+=a[i];//累加
	printf("%d",min(ans,k));//与k取最小
	return 0;
}
```

# 题解

这道题主要就是取最小值和判断。

~~所以这道题十分简单~~。

我的方法：每次输入时判断是否是目前这排的最小值。

如果是，则把最小值改为这个值。

最后把所有最小值相加，然后判断是否比食物多。

注意！必须判断是否比食物多!

所以我就用了简单的判断+循环来做，最后输出。

一开始我的代码：
```
#include<bits/stdc++.h>
using namespace std;
int main (){
unsigned long a,b,c,m,n,k,mmax[1005+1];
cin>>n>>m>>k;
for(int i=1;i<=n;i++)
{cin>>a>>b;
 mmax[a]=min(mmax[a],b)
}
for(int i=1;i<=m;i++)
{
c+=mmax[i];

}
if(c>k){cout<<k;}
else cout<<c;}
```
一看，~~哇~~ WA
分析，发现没有初始化设为最大值，导致都是0。

所以，修改后的代码：
```
#include<bits/stdc++.h>
using namespace std;
int main(){
unsigned long a,b,ans,m,n,k,maximum[1000+1];//定义变量
    cin>>n>>m>>k;//输入基础数据
 for(int i=1;i<=m;i++){maximum[i]=999999999;}//基础化
 for(int i=1;i<=n;i++)
 {
       cin>>a>>b;
       maximum[a]=min(maximum[a],b);//判断是不是目前这排最小的
 }
 for(int i=1;i<=m;i++)
 {
       ans+=maximum[i];
 }
 if(ans>k) cout<<k;//是否能全部吃完
    else cout<<ans;
return 0;
}
```

